INSERT INTO `transfer_reservation_multi_lang` (`id`, `foreign_id`, `model`, `locale`, `field`, `content`, `source`) VALUES('666', '1', 'pjOption', '1', 'o_email_cancel_message', '<p style="text-align: left;">We regret that you decided to cancel your transfer with us. If the reason for your cancellation is a cheaper transfer with a different transfer company, please contact us.</p>\r\n<p style="text-align: left;">We confirm the cancellation of the following&nbsp;transfer:&nbsp;</p>\r\n<p style="text-align: left;">&nbsp;</p>\r\n<p style="text-align: left;"><strong>Passenger Details</strong><br />Name and Surname: {Title} {FirstName} {LastName}<br />Mobile Number: {Phone}<br />Email Address: {Email}<br />Country: {Country}</p>\r\n<p style="text-align: left;">&nbsp;</p>\r\n<p style="text-align: left;"><strong>Transfer Details</strong><br />Date {Date}<br />Time: {Time}<br />From: {From}<br />To: {To}</p>\r\n<p style="text-align: left;">[FromAirport]Arrival Flight Number: {FlightNumber}<br />Airline Name: {AirlineCompany}<br />Destination Address: {DestinationAddress}<br />Name of Hotel/Pension: {Hotel}[/FromAirport][FromLocation]Pick-up Address: {Address}<br />Name of Hotel/Pension: {Hotel}<br />Flight Departure Time: {FlightDepartureTime}[/FromLocation]<br />Passengers: {Passengers}<br />Vehicle: {Fleet}</p>\r\n<p style="text-align: left;">Further Information or Requests: {Notes}</p>\r\n<p style="text-align: left;">&nbsp;</p>\r\n<p style="text-align: left;">[HasReturn]<strong>Return Transfer Details</strong><br />Date: {ReturnDate}<br />Time: {ReturnTime}<br />From: {ReturnFrom}<br />To: {ReturnTo}&nbsp;<br />[ReturnToAirport]Pick-up Address: {ReturnAddress}<br />Flight Departure Time: {ReturnFlightDepartureTime}[/ReturnToAirport][ReturnToLocation]Arrival Flight Number: {ReturnFlightNumber}<br />Airline Name: {ReturnAirlineCompany}[/ReturnToLocation]<br />Passengers: {Passengers}<br />Vehicle: {Fleet}<br />Further Information or Requests: {ReturnNotes}[/HasReturn]</p>\r\n<p style="text-align: left;">&nbsp;</p>\r\n<p style="text-align: left;">Extras:</p>\r\n<p style="text-align: left;">{Extras}</p>\r\n<p style="text-align: left;">&nbsp;</p>\r\n<p style="text-align: left;">Payment Method: {PaymentMethod}</p>\r\n<p style="text-align: left;">[HasDiscount]Discount: {Discount} ({DiscountCode})[/HasDiscount]</p>\r\n<p style="text-align: left;">[HasDeposit]Deposit: {Deposit}</p>\r\n<p style="text-align: left;">Rest to pay: {Rest}[/HasDeposit]<br />TOTAL: {Total}</p>\r\n<p style="text-align: left;">&nbsp;</p>\r\n<p style="text-align: left;">Do not hesitate to contact us, if you have any further questions or concerns.</p>\r\n<p style="text-align: left;">&nbsp;</p>\r\n<p style="text-align: left;">Best regards,</p>', 'data');
