INSERT INTO `transfer_reservation_multi_lang` (`id`, `foreign_id`, `model`, `locale`, `field`, `content`, `source`) VALUES('1291', '1429', 'pjField', '1', 'title', 'You can choose between the following three payment methods: <br/><br/><b>Credit Card in Advance</b><br/>After the booking 10 % of the price will be transferred as deposit from your credit card. The remaining amount will be transferred automatically on the day of your transfer. <b>Secure Credit Card Payment: This is a secure SSL encrypted payment.</b><br/><br/><b>Cash on the day of Transfer</b><br/>Conveniently pay our driver in cash on the day of your transfer.<b/><br/><br/><b>Credit Card on the day of Transfer</b><br/>Conveniently pay our driver by Credit Card on the day of your transfer.<br/><br/>If you have a discount code, enter the code into the provided field and press enter. ', 'script');
