INSERT INTO `transfer_reservation_multi_lang` (`id`, `foreign_id`, `model`, `locale`, `field`, `content`, `source`) VALUES('1347', '1', 'pjOption', '1', 'o_email_reminder_message', '<p style="text-align: left;">Thank you {Title} {FirstName} {LastName} for choosing us for your transfer.</p>\r\n<p style="text-align: left;">This is a reminder of your private transfer. Our driver will be waiting for you with a name plate at the airport or at the reception of your accommodation. The distance from your pick-up location to your destination is {Distance} km and it will take us approximately {Duration} minutes to reach your destination. Please check the details below. &nbsp;</p>\r\n<p style="text-align: left;"><br /><strong>Passenger Details</strong><br />Name and Surname: {Title} {FirstName} {LastName}<br />Mobile Number: {Phone}<br />Email Address: {Email}<br />Country: {Country}</p>\r\n<p style="text-align: left;">&nbsp;</p>\r\n<p style="text-align: left;"><strong>Transfer Details</strong><br />Date {Date}<br />Time: {Time}<br />From: {From}<br />To: {To}</p>\r\n<p style="text-align: left;">[FromAirport]Arrival Flight Number: {FlightNumber}<br />Airline Name: {AirlineCompany}<br />Destination Address: {DestinationAddress}<br />Name of Hotel/Pension: {Hotel}[/FromAirport][FromLocation]Pick-up Address: {Address}<br />Name of Hotel/Pension: {Hotel}<br />Flight Departure Time: {FlightDepartureTime}[/FromLocation]<br />Passengers: {Passengers}<br />Vehicle: {Fleet}</p>\r\n<p style="text-align: left;">Further Information or Requests: {Notes}</p>\r\n<p style="text-align: left;">&nbsp;</p>\r\n<p style="text-align: left;">[HasReturn]<strong>Return Transfer Details</strong><br />Date: {ReturnDate}<br />Time: {ReturnTime}<br />From: {ReturnFrom}<br />To: {ReturnTo}&nbsp;<br />[ReturnToAirport]Pick-up Address: {ReturnAddress}<br />Flight Departure Time: {ReturnFlightDepartureTime}[/ReturnToAirport][ReturnToLocation]Arrival Flight Number: {ReturnFlightNumber}<br />Airline Name: {ReturnAirlineCompany}[/ReturnToLocation]<br />Passengers: {Passengers}<br />Vehicle: {Fleet}<br />Further Information or Requests: {ReturnNotes}[/HasReturn]</p>\r\n<p style="text-align: left;">&nbsp;</p>\r\n<p style="text-align: left;">Extras:</p>\r\n<p style="text-align: left;">{Extras}</p>\r\n<p style="text-align: left;">&nbsp;</p>\r\n<p style="text-align: left;">Payment Method: {PaymentMethod}</p>\r\n<p style="text-align: left;">[HasDiscount]Discount: {Discount} ({DiscountCode})[/HasDiscount]</p>\r\n<p style="text-align: left;">[HasDeposit]Deposit: {Deposit}</p>\r\n<p style="text-align: left;">Rest to pay: {Rest}[/HasDeposit]<br />TOTAL: {Total}<br /><br />Please inform us if you found any mistakes in your booking details. Please inform us, if your flight details have changed.</p>\r\n<p style="text-align: left;">Do not worry, if your flight is delayed. Your personal driver will track your flight and will be waiting for you at the airport until you arrive. &nbsp;</p>\r\n<p style="text-align: left;">We also sent you a notification via SMS with the number of your personal driver. If you have any problems or questions, please contact your driver with this number.</p>\r\n<p style="text-align: left;">Please do not hesitate to contact us, if you have any problems or further questions.&nbsp;</p>\r\n<p style="text-align: left;">&nbsp;</p>\r\n<p style="text-align: left;">Best regards,</p>\r\n<p style="text-align: left;">&nbsp;</p>\r\n<p style="text-align: left;">&nbsp;</p>', 'data');
