INSERT INTO `transfer_reservation_multi_lang` (`id`, `foreign_id`, `model`, `locale`, `field`, `content`, `source`) VALUES('1392', '1', 'pjOption', '1', 'o_shared_trip_info', '<p style="text-align: left;">If someone else booked a transfer on the same day and time from the same departure location and with the the same destination, we provide the option to share a car. If you would like to make use of this alternative, you can save up to 30 %. You will lose no time, since the customer you share a car with chose the same destination as you. <strong>We cannot guarantee a car share, since it depends on our other bookings. However, if a car share is possible, we will be happy to offer it to you.</strong></p>\r\n<p style="text-align: left;">&nbsp;</p>\r\n<p style="text-align: left;"><strong>We will send you a notification one day in advance to inform you, if you will be sharing a car with someone.</strong></p>', 'data');
